INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('8002974024176', 'Pancetta traditionnelle', 'Les pancetta Villani sont issues de porcs italiens et sélectionnées maigres - La salaison au sel marin, poivre blanc, fleur de muscade, Clou de girofle cannelle en plus de l\'affinage lent et graduel, lui confèrent douceur et appétence. A déguster avec du pain de campagne à pane grilié. Conseil . ouvrir la barquette à peine sortie du frigo, attendre 5/10 min avant de déguster. Le tranchage Villani : Nous ne tranchons pas à 100 km/h car nous refusons de pré-congeler nos produits pour les trancher plus rapidement. Nous avons à cœur de trancher en respectant la qualité du produit allant jusqu\'à déposer à la main les tranches dans la barquette. Comme les vrais charcutiers} En 1886 naît à Castelnuovo Rangone (près de Modène) l\'entreprise Villani, une famille d\'artisan charcutiers dont la passion se ttansmet de génération en génération, fière de ses recettes séculaires. Villani, le symbole de la charcuterie italienne d\'excellence. Villani SQ.A. via Zanasi 24 --- Castelnuovo Rangone (Modène) Italie. www.villanisalumi.it', 'https://static.openfoodfacts.org/images/products/800/297/402/4176/front_fr.4.400.jpg', '35', '14', '0.5', '0.5', '', '15', '4', '1.5748031496063', '', '0');

